import React from "react";
import { BottomNavigation, BottomNavigationAction } from '@material-ui/core';
import Icon from '@material-ui/core/Icon';
import { HomeIcon } from '@material-ui/icons/Home';





const Navbar = () => {


  return (
    <>
      <BottomNavigation>

        <BottomNavigationAction label="Recents" icon={<HomeIcon style={{ fontSize: 80 }} />} />
        <BottomNavigationAction label="Recents" icon={<Icon style={{ fontSize: 30 }}>add_circle</Icon>} />

      </BottomNavigation>

    </>
  )
};

export default Navbar;
